import React, { Component } from "react";

export class ParrentComponent extends Component {
	constructor(props) {
		super(props);

		this.state = {
			parentName: "Parent"
		};
		this.greetParent = this.greetParent.bind(this);
	}

	greetParent() {
		alert(`Hello ${this.state.parentName}`);
	}
	render() {
		return <div></div>;
	}
}

export default ParrentComponent;
